import logo from "./logo.svg";
import "./App.css";
import "./QuizPage";

function App() {
  return (
    <div>
      <div className="Navigation-bar">
        <div className="dropdown">
          <button className="dropbtn">Quizzes</button>
          <div className="dropdown-content">
            <a href="#">Quiz 1</a>
            <a href="#">Quiz 2</a>
            <a href="#">Quiz 3</a>
          </div>
        </div>
        <a href="Help.asp">Help</a>
        <div className="Float-right">
          <a href="Quit.asp">Quit</a>
        </div>
      </div>
      <header className="App-header">Welcome to the Quiz Page!</header>
      <p className="App-main">
        Please select a Quizz from the Quizzes section.
      </p>
      <p className="footer">This is the Footer</p>
    </div>
  );
}

export default App;
